import Api from "../../API/Api";

export class FrmLoginController{

        static async ValidarLogin(){
            const resultado = await Api.get("/api/Usuario/ValidarUsuario",{params:{parLogin:"admin", parSenha:"admin"}}).then((res)=> res.data)
            return resultado;
        }

}
